import React from 'react';
import './navigation.css';

const Navigation =() => {
    return (
        <nav className="navbar navbar-light bg-light ">
            <button href="#" className='btn btn-outline-success ml-auto my-2 my-sm-0'>Sign Out</button>
        </nav>
    );
}

export default Navigation;
